  true,\n\t\"url\": null,\n\t\"notes\": \"The Atmospheric Infrared Sounder (AIRS)
  is a facility instrumentn            aboard the second Earth Observing System (EOS)
  polar-orbitingn            platform, EOS Aqua. In combination with the Advanced
  Microwaven            Sounding Unit (AMSU) and the Humidity Sounder for Brazil Humidityn
  \           Sounder for Brazil (HSB), AIRS constitutes an innovative atmosphericn
  \           sounding group of visible, infrared, and microwave sensors.  AIRS datan
  \           will be generated continuously. Global coverage will be obtained twicen
  \           daily (day and night) on a 1:30pm sun synchronous orbit from a 705-kmn
  \           altitude.n                                                      n            The
  AIRS IR Level 1B QA Subset contains Quality Assurance (QA)n            parameters
  that a user of may use to filter AIRS IR Level 1B radiancen            data to create
  a subset of analysis. QA parameters indicate quality ofn            granule-per-channel,
  scan-per-channel, field of view, and channel andn            should be accessed
  before any data of analysis. It also containsn            \"glintlat\", \"glintlon\",
  and \"sun_glint_distant\" that users can use ton            check for possibility
  of solar glint contamination.n                                                      n
  \           AIRS IR Level 1B radiance data can be found in AIRIBRAD.  nn            (The
  Shortname for this product is AIRIBQAP).n                                                      n
  \           Coverage: Global, Twice Daily (Daytime and Nighttime)n            Resolution:
  13.5 km at nadir; 41 km x 21.4 km at the scan extremesn            Spectral Range:
  2378 channels fromn            3.74 - 4.61 umn            6.20 - 8.22 umn            8.8
